INSERT INTO `profile` (`id_info`, `judul_info`, `isi_info`, `pegawai`) VALUES
(1, 'PROFILE DESA', 'Desa Tugu adalah salah satu desa dari 11 desa  yang terletak di Kecamatan Lelea Kabupaten Indramayu.', 'Dhea Mahda'),
(3, 'VISI', '\"TERWUJUDNYA DESA TUGU YANG AMAN, SEHAT, CERDAS, BERDAYA SAING, BERBUDAYA DAN BERAKHLAQ\"', 'Dhea'),
(4, 'MISI', '1.	MEWUJUDKAN KEAMANAN DAN KETERTIBAN DI LINGKUNGAN DESA TUGU\r\n\r\n\r\n2.	MENINGKATKAN KESEHATAN, KEBERSIHAN DESA SERTA MENGUSAHAKAN JAMINAN KESEHATAN MASYARAKAT MELALUI PROGRAM PEMERINTAH.\r\n\r\n\r\n3.	MEWUJUDKAN DAN MENINGKATKAN TATA KELOLA PEMERINTAHAN DESA YANG BAIK.\r\n\r\n\r\n4.	MENINGKATKAN PELAYANAN YANG MAKSIMAL KEPADA MASYARAKAT DESA DAN DAYA SAING DESA\r\n\r\n\r\n5.	MENINGKATKAN KESEJAHTERAAN MASYARAKAT DESA DENGAN MEWUJUDKAN BADAN USAHA MILIK DESA (BUMD) ATAU KOPERASI DESA (KOPDES) DAN PROGRAM LAIN UNTUK MEMBUKA LAPANGAN KERJA BAGI MASYARAKAT DESA SERTA MENINGKATKAN PRODUKSI RUMAH KECIL.\r\n\r\n\r\n6.	MENINGKATKAN SARANA DAN PRASARANA DARI SEGI FISIK, EKONOMI, PENDIDIKAN, KESEHATAN DAN KEBUDAYAAN DI DESA TUGU.\r\n\r\n7.	MENINGKATKAN KEHIDUPAN YANG HARMONIS, TENTRAM, SALING MENGHORMATI DALAM KEHIDUPAN BERBUDAYA DAN BERAGAMA DI DESA TUGU.\r\n\r\n\r\n8.	MENGEDEPANKAN KEJUJURAN, KEADILAN, TRANSPARANSI DALAM KEHIDUPAN SEHARI-HARI BAIK DALAM PEMERINTAHAN MAUPUN DENGAN MASYARAKAT DESA TUGU.\r\n', 'Dhea'),
(5, 'PROGRAM KERJA', '', ''),
(9, 'A. BIDANG PEMERINTAHAN', 'Pemerintahan Desa merupakan unit terkecil dari pemerintahan nasional. Dimana berbagai permasalahan dimulai dari desa. Untuk itu pemerintahan desa harus solid, akuntabel, professional, amanah serta ramah dalam memberikan pelayanan terhadap masyarakat. Untuk mencapai hal tersebut di atas dan menciptakan pemerintahan yang baik, maka perlu dilakukan beberapa hal, antara lain :\r\n\r\n1.	Pembenahan Aparatur Pemerintah Desa\r\nAparatur Pemerintah Desa Tugu perlu dibenahi dan dibina agar masing-masing bidang dapat berfungsi dengan baik dan dalam melaksanakan tugas sesuai dengan tupoksi masing-masing, sehingga tidak terjadi tumpang tindih tugas. Dengan demikian diharapkan aparatur pemerintah desa akan mendapat kepercayaan dari masyarakat.\r\n2.	Peningkatan Pelayanan Publik\r\nPelayanan terhadap masyarakat perlu ditingkatkan sehingga masyarakat dengan mudah memperoleh pelayanan sesuai dengan kebutuhan dengan tidak membedakan status dalam masyarakat sepanjang pelayanan yang dibutuhkan oleh masyarakat tidak bertentangan dengan norma-norma dan hukum yang berlaku.\r\n3.	Transparansi Keuangan\r\nUntuk meningkatkan kepercayaan masyarakat kepada Kepala Desa/Kuwu dan aparaturnya, masalah keuangan harus transparansi (terbuka). Transparansi keuangan yang dimaksud adalah dimana masyarakat harus mengetahui sumber-sumber keuangan yang didapat dengan pengalokasiannya minimal satu kali dalam setahun dan membuat laporan kepada BPD dan disosialisasikan kepada masyarakat melalui RT.\r\n4.	Sisenergitas dengan BPD\r\nBadan Permusyawaratan Desa (BPD) yang anggotanya merupakan tokoh/ wakil masyarakat dan sebagai mitra sejajar kepala desa serta penampung aspirasi masyarakat, harus diajak musyawarah terutama menyangkut masalah-masalah yang strategis terhadap pembangunan di desa. Selain itu BPD juga dapat diminta pendapat sesuai dengan tugas dan fungsinya.\r\n\r\n\r\n2.	Pembangunan Fisik\r\na.	Pembangunan Sarana Transportasi\r\nPembangunan Sarana Transportasi diarahkan untuk menjaga perekonomian masyarakat yaitu dengan pengecoran jalan dan pelebaran jalan sempit agar transportasi hasil pertanian lancar. \r\nb.	Pembangunan Sarana Kesehatan\r\nPembangunan Sarana Kesehatan antara lain Puskesmas dan Posyandu\r\nc.	Pembangunan Sarana Keamanan\r\nPembangunan Sarana Keamanan antara lain Pengadaan Poskamling di setiap dusun.\r\nd.	Pembangunan Sarana Pendidikan\r\nPembangunan Sarana Pendidikan formal dan  non formal. Pendidikan Formal antara lain TK/PAUD, SD/MI. sedangkan Pendidikan Non Formal diantaranya TPA dan DIniyah.\r\ne.	Pembangunan Sarana Olahraga\r\nPembangunan Sarana Olahraga antara lain Lapangan Sepak Bola, Badminton, Volly, Futsal dan lain-lain.\r\n3.	Pembangunan Bidang Pertanian\r\nSebagian besar penduduk Desa Tugu adalah hidup dari pertanian. Untuk itu wajar apabila pertanian mendapatkan perhatian khusus. Dan yang perlu ditingkatkan pada bidang ini antara lain :\r\na.	Penyuluhan kepada para petani.\r\nb.	Pengaturan air untuk pertanian\r\nc.	Membentuk/mengoptimalkan kelompot tani. \r\n', 'Dhea'),
(11, 'B.	BIDANG PEMBANGUNAN', 'Pembangunan pada hakekatnya adalah mengadakan perubahan terhadap sesuatu dari yang tidak/kurang baik menjadi baik, dari yang tidak manfaat menjadi manfaat dan dari rusak menjadi bagus. Pembangunan ada 2 (dua) momen yaitu pembangunan mental atau akhlaq dan pembangunan fisik.\r\n1.	Pembangunan Akhlaq\r\nPembangunan akhlaq diarahkan untuk menjadi manusia yang berakhlaqul karimah sehingga terwujud kehidupan yang rukun dan harmonis bagi semua warga desa.\r\n\r\n\r\n2.	Pembangunan Fisik\r\na.	Pembangunan Sarana Transportasi\r\nPembangunan Sarana Transportasi diarahkan untuk menjaga perekonomian masyarakat yaitu dengan pengecoran jalan dan pelebaran jalan sempit agar transportasi hasil pertanian lancar. \r\nb.	Pembangunan Sarana Kesehatan\r\nPembangunan Sarana Kesehatan antara lain Puskesmas dan Posyandu\r\nc.	Pembangunan Sarana Keamanan\r\nPembangunan Sarana Keamanan antara lain Pengadaan Poskamling di setiap dusun.\r\nd.	Pembangunan Sarana Pendidikan\r\nPembangunan Sarana Pendidikan formal dan  non formal. Pendidikan Formal antara lain TK/PAUD, SD/MI. sedangkan Pendidikan Non Formal diantaranya TPA dan DIniyah.\r\ne.	Pembangunan Sarana Olahraga\r\nPembangunan Sarana Olahraga antara lain Lapangan Sepak Bola, Badminton, Volly, Futsal dan lain-lain.\r\n3.	Pembangunan Bidang Pertanian\r\nSebagian besar penduduk Desa Tugu adalah hidup dari pertanian. Untuk itu wajar apabila pertanian mendapatkan perhatian khusus. Dan yang perlu ditingkatkan pada bidang ini antara lain :\r\na.	Penyuluhan kepada para petani.\r\nb.	Pengaturan air untuk pertanian\r\nc.	Membentuk/mengoptimalkan kelompot tani. \r\n\r\n', 'Dhea'),
(12, 'C.	BIDANG SOSIAL DAN KEMASYARAKATAN', '1.	Lembaga Pemberdayaan Masyarakat Desa\r\nLembaga Pemberdayaan Masyarakat Desa (LPM) adalah lembaga kemasyarakatan yang bertujuan menggerakkan pembangunan desa dan mengembangkan partisipasi, gotong royong dan fungsinya.\r\n\r\n2.	Pembinaan Kinerja RT dan RW\r\nRukun Tetangga (RT) merupakan pemimpin yang paling bawah dan yang paling dekat dengan masyarakat. Permasalahan – permasalahan yang muncul di lingkungan masyarakat sehingga keberadaan RT dan RW perlu dibina dalam menyelesaikan masalah lingkungannya.\r\n\r\n3.	Pembinaan Generasi Muda\r\nPembinaan Generasi Muda sangat penting karena generasi muda adalah milik Negara di masa yang akan dating. Oleh karena itu, yang sangat penting membina akhlaq melalui pengajian-pengajian, ceramah agama, diskusi keagamaan melalui remaja masjid, karang taruna dan yang sejejnisnya. Selain akhlaq generasi muda harus kuat fisiknya yaitu melalui pembinaan olahraga melalui wadah karang taruna yang semuanya itu untuk mendukung dan berperan dalam memajukan Desa Tugu. \r\n\r\n4.	Pembinaan PKK\r\nPKK merupakan wadah pembinaan ibu-ibu. Diharapkan perannya dalam masyarakat dapat meningkatkan peran ibu dalam mendidik anak, meminimalisir kenakalan remaja, pergaulan bebas, kekerasan terhadap anak. Karena ibu adalah pendidik anak yang pertama dan utama dalam keluarga sehingga ketika anak remaja meskipun anak gaul tetap berakhlaq mulia.\r\n\r\n5.	Lembaga Lain\r\nLembaga lain yang berada di Desa Tugu harus dapat memberikan kontribusinya terhadap kemajuan pembanguna Desa Tugu. Lembaga-lembaga ini antara lain :\r\na.	Koperasi Desa (Kopdes)\r\nKoperasi Desa merupakan badan profit yang harus mampu meningkatkan kesejahteraan warga. Lembaga ini belum berfungsi karena belum ada modal dan penguatan kelambagaannya.\r\nb.	Gabungan Kelompok Tani Maju (Gapoktan)\r\nKelompok tani yang sudah banyak memberikan kontribusi yang besar terhadap pertanian di Desa Tugu.\r\nc.	Kelompok Informasi Masyarakat Tugu (KIM Tugu)\r\nAdalah lembaga layanan informasi bagi masyarakat Desa Tugu.\r\n\r\n', ''),
(13, 'MONOGRAFI DESA TUGU', '\r\n\r\n1.	UMUM\r\nLuas Wilayah 	: 687,585 Hektar\r\nKoordinat Bujur 	: 108.218658\r\nKoordinat Lintang 	: -6.512463\r\nKetinggian di atas Permukaan Laut 	: 16.66 Meter\r\n2.	BATAS WILAYAH \r\nSebelah Utara 	: Desa Nunuk\r\nSebelah Timur 	: Desa Rancasari\r\nSebelah Selatan 	: Desa Tunggulpayung\r\nSebelah Barat 	: Desa Jambak\r\n3.	KEPENDUDUKAN\r\nJumlah Penduduk 	: 6263 jiwa\r\nPenduduk Laki-laki 	: 3066 jiwa\r\nPenduduk Perempuan 	: 3197 jiwa\r\nJumlah Kepala Keluarga 	: 2172 KK\r\n4.	KELEMBAGAAN\r\nJumlah Perangkat Desa 	: 23 Orang\r\nJumlah Anggota BPD 	:   9 Orang \r\nJumlah Anggota LPM 	: 16 Orang\r\nJumlah Anggota PKK 	: 26 Orang\r\nJumlah Anggota MUI 	:   7 Orang\r\nJumlah Anggota Karang Taruna 	: 16 Orang \r\n5.	SARANA PRASARANA\r\nGedung Pemerintahan 	: 1 Unit\r\nGedung Lembaga Kemasyarakatan 	: 1 Unit\r\n6.	LEMBAGA PENDIDIKAN\r\nPAUD / TK 	: 3 buah\r\nSekolah Dasar 	: 3 buah\r\nMadrasah Diniyah 	: 3 buah\r\nMajlis Ta’lim 	: 10 buah\r\n7.	SARANA IBADAH \r\nMasjid 	: 3 buah\r\nMusholla 	: 21 buah\r\nGereja 	: 1 buah\r\n\r\n', 'Dhea');

