INSERT INTO `update_info` (`id_info`, `judul_info`, `info`, `tag_info`, `image`, `id_komentar`, `id_staff`) VALUES
(4, 'Keamaan adalah hal sangat diperlukan ', 'Peran mitra strategis dalam mendorong kondusivitas Kota Bandung dan Jawa Barat pada umumnya terutama dalam melakukan pencegahan dini terhadap upaya instabilitas dan penanganan konflik masyarakat sangat berkontribusi optimal.\r\n\r\nSekretaris Daerah Kota Bandung, Yossi Irianto berharap, konsolidasi, koordinasi dan komunikasi antar forum mitra dengan Badan Kesatuan Bangsa dan Politik (Kesbangpol) Kota Bandung khususnya, sangat diperlukan dan menjadi langkah strategis.\r\n\r\n“Rapat koordinasi sangat penting, karena sebagai pemerintah memerlukan peranan penting yang nantinya berkaitan dengan Ilmu politik ekonomi sosial budaya pertahanan dan keamanan (Ipoleksosbudhankam),” ucapnya.\r\n\r\nMenurut Yosi, kegiatan ini penting dan perlu terus dilakukan sebagai media yang berbasis forum dan menjadi media konsolidasi bagi mitra yang ada, sehingga sudah jelas bertujuan untuk mendeteksi dini apa yang menjadi persoalan.\r\n\r\n“Kegiatan ini harus dikembangkan agar menghasilkan kesamaan untuk menjaga ideologi Pancasila,\" ujar Yosi, pada Rakor Strategi dan Peran Forum-forum Mitra Strategis Badan Kesatuan Bangsa dan Politik dalam Penguatan Ideologi Pancasila tahun 2017 di Hotel Cipaku Bandung, Rabu (05/04).\r\n\r\nYosi menegaskan, tidak hanya peran pemerintah saja untuk menjaga ideologi, tetapi peran TNI dan Polri yang nantinya bisa menambah penguatan.\r\n\r\n“Dengan strategi dan cara khusus mungkin instansi yang berkaitan bisa melakukannya, oleh karenanya harus ditingkatkan kolaborasi baik pemerintah maupun instansi yang berkaitan serta masyarakat,” katanya. (Parno)', 'keamanan', , 0, 1703034);
INSERT INTO `update_info` (`id_info`, `judul_info`, `info`, `tag_info`, `image`, `id_komentar`, `id_staff`) VALUES
(5, 'Jalanan banyak sampah ', 'Bekasi - Sampah berserakan di pinggir jalan di Tarumajaya, Kabupaten Bekasi, Jawa Barat. Bau menyengat pun tercium saat melintasi kawasan itu.\r\n\r\nPantauan detikcom, sampah itu berserakan tepatnya di Jalan Prapatan, Jalan Mutiara Gading, Jalan Puri Harapan, Desa Setiaasih, Kecamatan Tarumajaya, Kabupaten Bekasi. Sampah plastik, bekas makanan, hingga botol plastik tampak berceceran.\r\n\r\nBaca juga: Sampah di Bawah Jembatan Ampera, Denda Rp 50 Juta Tak Efektif\r\n\r\nKetua RT 030 Desa Setiaasih, Taufik, mengatakan para pekerja yang berangkat pagi hari sering membawa kantong berisi sampah dan dibuang di pinggir jalan. Pasalnya, Jalan Prapatan, Jalan Mutiara Gading, dan Jalan Puri Harapan adalah jalan yang sering dilintasi pengendara menuju Jakarta.\r\n\r\n\"Itu (ulah) warga yang berangkat kerja pagi-pagi. Dia suka buang di situ. Artinya, kita bukan suuzan sih, tapi warga luar sini sih. Saya sering tegur (orang yang buang sampah di pinggir jalan),\" ujar Taufik kepada detikcom, Kamis (20/9/2018).\r\n\r\nSetiap hari Kamis, petugas kebersihan dari Pemkab Bekasi datang ke lokasi untuk membereskan sampah-sampah yang berserakan itu. Sebagian sampah diangkut, sebagian dibakar.\r\n\r\n\"Kadang-kadang habis Magrib sampah saya bakar. (Petugas) dari Kabupaten datang setiap Kamis, ada yang diangkut, ada yang dibakar,\" ujar Taufik.', 'Infrastruktur', , 0, 1703034);
INSERT INTO `update_info` (`id_info`, `judul_info`, `info`, `tag_info`, `image`, `id_komentar`, `id_staff`) VALUES
(15, 'Anak muda ', 'KOMPAS.com – Tiap pagi kawasan Jalan Dago Pojok, Bandung, terasa sesak. Meski bukan jalan raya, jalur tersebut menjadi tempat lalu-lalang beragam alat transportasi yang jalan tersendat-sendat lantaran macet. Memang, sejak dulu Dago Pojok menjadi jalan alternatif para pengendara. Sasaran mereka adalah sekolah dan kantor yang jaraknya lebih cepat ditempuh lewat gang sempit itu. Nirwan adalah satu dari pengendara motor yang kerap menyambangi jalan tersebut. Dia harus rela berjejal di Dago Pojok untuk mencapai sekolahnya di SMAN 19. Letaknya, kurang lebih 300 meter dari jalan utama. Secara normal, jauhnya jarak itu hanya memakan waktu dua menit bila berkendara atau lima sampai tujuh menit jika berjalan kaki. Masalahnya, kondisi macet membuat waktu tempuh menjadi lebih lama lagi. Makin lama volume kendaraan roda dua terus bertambah, terutama karena banyak siswa mengendarai motor. Akibatnya, bukan hanya rugi waktu, tapi lahan parkir juga semakin sempit. \'Saya pernah ada di dua posisi. Sebagai pengendara motor yang tidak menawarkan pada teman yang berjalan kaki, maupun sebagai pejalan kaki yang tidak ditawarkan tumpangan oleh teman pengendara motor,\" tutur Nirwan, Rabu (02/09/2015). Tertarik menemukan jalan keluar, Nirwan dan kawannya, Farizd Abdullah Labaik Rachmat berunding melahirkan konsep \"Babarengan 19\". Konsep ini menekankan pada solusi yang bersifat sosial, sederhana sehingga mudah direalisasikan, dan mampu membawa perubahan positif. Lalu, dengan dukungan sekolah, lahirlah peraturan baru. Mulai Maret 2015 lalu, siswa bermotor di SMAN 19 diizikan masuk gerbang sekolah bila mereka memiliki Surat Izin Mengemudi (SIM) dan memberi tumpangan pada seorang temannya. Untuk memuluskan konsep ini, sebuah halte di jalan utama, Jl Ir. H. Juanda dekat Hotel Sheraton Bandung pun dijadikan tempat menunggu untuk mencari motor tumpangan. Selain mengurangi jumlah kendaraan motor di sekolah, juga memicu siswa untuk saling bertegur sapa. Dampaknya mulai terasa setelah enam bulan peraturan tersebut direalisasi Dampak lain, lahan parkir SMAN 19 mulai terasa lengang, kondisi macet di Dago Pojok berangsur menurun. Atas prakarsa itu, Nirwan dan Faridz bahkan menyabet penghargaan \'Best of The Best Toyota Eco Youth 9 2015\'. Kompetisi tahunan ini bertujuan merangsang generasi muda Indonesia untuk semakin sadar, peduli, dan mau berpikir solutif terhadap permasalahan yang terjadi di lingkungan sekitar mereka. Mulai Maret lalu, siswa bermotor di SMAN 19, Bandung, diizikan masuk gerbang sekolah bila mereka memiliki Surat Izin Mengemudi (SIM) dan memberi tumpangan pada seorang temannya.(DOK. TMMIN) Mengurai kemacetan Konsep serupa sebenarnya telah dilakoni oleh komunitas Nebengers di Ibukota. Beberapa orang pemuda menggagasnya dengan pertimbangan kondisi lalu-lintas Jakarta. Dilansir dari KOMPAS.com, prediksi Badan Kerja Sama Internasional Jepang (JICA) memaparkan bahwa kerugian ekonomi akibat kemacetan di DKI Jakarta periode 2002-2020 akan mencapai Rp 65 triliun. Angka kerugian itu didapat dengan cara menghitung kerugian karena aktivitas ekonomi yang terhambat atau bahkan lumpuh akibat kemacetan di Jakarta (Baca: Macet Bawa Kerugian Rp 65 Triliun). Cara kerja komunitas ini ialah berbagi tumpangan dengan anggota komunitas saat memiliki rute perjalanan searah. Calon penumpang dan pemberi tumpangan harus melakukan registrasi sebelum berinteraksi. Lewat komunitas itu, mereka diwadahi untuk berbagi informasi siapa saja yang butuh tumpangan serta pengendara baik hati yang rela memberi tumpangan. Imbalannya sukarela, dapat berupa bensin, uang tol atau bergantian mengemudi. Gerakan yang digagas ini menghasilkan tiga dampak positif langsung. Secara sosial, meningkatkan interaksi antar masyarakat. Secara lingkungan, dapat mengurangi polusi dan tingkat kemacetan. Sedangkan secara ekonomi, gerakan tersebut dapat menekan pengeluaran masyarakat. Beberapa manfaat ini juga yang tengah dirasakan Nirwan dan siswa lainnya saat \"Babarengan 19\" mulai digalakkan di sekolahnya. \"Khusus dalam lingkup SMAN 19, konsep ini meningkatkan interaksi antar siswa, misalnya kakak kelas dan adik kelas sehingga stigma senioritas pun hilang. Selain itu, cara ini dapat mengurangi angka kecelakaan lalu lintas dan menekan ongkos ke sekolah,\" kata Nirwan. Membangunkan generasi muda Fenomena menarik hari ini adalah kaum muda tak malu lagi menciptakan dan menunjukkan berbagai karya pada masyarakat. Kisah mengurai kemacetan tadi menyadarkan bahwa pemuda mulai terjun sebagai pemberi solusi. Di luar, masih banyak isu lingkungan dan sosial yang menunggu dipecahkan. Selain pendidikan, komunitas dan gerakan diharapkan menjadi penggerak terintegrasi agar pemuda memiliki cara pandang lain dalam menghadapi isu sosial. Untuk mengasah daya pikir, beberapa kompetisi melalui lembaga pemerintah dan swasta pun diadakan. Beberapa diantaranya adalah lomba karya tulis yang diadakan Kementerian Pendidikan dan Kebudayaan (Kemdikbud), kompetisi karya ilmiah dan sains yang diadakan Lembaga Ilmu Pengetahuan Indonesia (LIPI), kompetisi kewirausahaan yang diselenggarkan Bank Mandiri, dan kompetisi proposal hijau berbasis riset dalam bidang sosial dan sains garapan PT Toyota Motor Manufacturing Indonesia (TMMIN). Hal tersebut membuktikan bahwa konsentrasi agar pemuda dapat memberikan kontribusi langsung pada masyarakat sedang menjadi perhatian banyak pihak. \"Perkembangan sekarang ini luar biasa drastis sehingga anak muda yang merupakan potensi besar ini (dengan kemudahan informasi) berkesempatan untuk menyingkapi isu dengan cepat,\" kata Direktur Corporate and External Affair Directorate PT TMMIN I Made Tangkas, Rabu (02/09/2015) di Jakarta. Made mengatakan bahwa memang itulah tantangan generasi sekarang. Khususnya, mereka harus merespon cepat sebagai bagian dari Sumber Daya Manusia (SDM) berkualitas. \"Tantangan semakin besar ini harus disadari dan dipahami anak muda Indonesia. Jadi saat melakukan bisnis apapun nanti, mereka sadar pentingnya manajemen lingkungan,\" katanya.\r\n\r\nArtikel ini telah tayang di Kompas.com dengan judul \"Banggalah Berkarya di Usia Muda! \", https://edukasi.kompas.com/read/2015/09/05/08110031/Banggalah.Berkarya.di.Usia.Muda.. \r\nPenulis : Sri Noviyanti', 'Sosial', , 0, 1703034);
