(17, 'KOTA NGAROT', 'Tradisi Ngarot adalah tradisi masyarakat desa Lelea yang diselenggarakan setiap tahun. Tradisi ini dilaksanakan sebagai ungkapan rasa syukur petani menjelang masa tanam padi. Selain ungkapan rasa syukur, tradisi ngarot juga dilaksanakan sebagai bentuk penghormatan kepada leluhur mereka yang disebut Ki Buyut Kapol.\r\n\r\nDahulu, Ki Buyut Kapol yang kaya raya sangat prihatin melihat keadaan warga desa Lelea yang hidup dengan kemiskinan dan tanpa keterampilan. Oleh sebab itu, Ki Buyut Kapol memberikan sawahnya yang seluas 26.100 meter persegi. Sawah tersebut kemudian diolah bersama-sama. Awal pengolahan sawah dilaksanakan pada musim hujan yang jatuh pada bulan Desember, tepatnya minggu ketiga dan jatuh pada hari rabu.\r\n\r\nTradisi Ngarot dimulai sejak abad 17 M, tepatnya sekitar tahun 1686. Sejak tradisi ngarot secara rutin dilaksanakan, perekonomian masyarakat mulai membaik. Tradisi ngarot pantang dilanggar, maka masyarakat sekitar bahwa akan ada marabahaya menimpa masyarakat, seperti dalam bentuk pengairan yang sulit yang kemudian mengakibatkan gagal panen.\r\n\r\nPersyaratan khusus yang diadakan sebelum ritual ngarot antara lain: pertama, peserta tradisi atau ritual ngarot harus terdiri dari pemuda-pemudi yang masih perjaka dan perawan. Jika tidak perawan, maka hiasan yang nantinya dikenakannya akan cepat layu dan pucat. Kedua, mempersiapkan segala persyaratan selama acara, seperti benih, kendi berisi air putih, cangkul, pupuk, ruas bambu kuning. Ketiga, mempersiapkan pengiring pesta ngarot seperti tanjidor, genjring, gong, gamelan, dan seni tari ronggeng ketuk.\r\n\r\nDalam pelaksanaannya, pemuda-pemudi harus berkumpul di kediaman kepala desa, kemudian berdandan dan tampil menarik melakukan pawai dan keliling hingga perbatasan desa. Mereka jalan diiringi alunan musik tanjidor dan genjring. Kemudian ada persembahan khusus, yaitu tari Jipang.\r\n\r\nSetelah memasuki aula Balai Desa, mereka dihibur dengan seni tradisional tari ronggeng ketuk yang dimaksudkan untuk menggoda agar para gadis dan jejaka saling berpandang-pandangan. Setelah selesai, baru mulai prosesi ritual ngarot dengan intinya sebagai waktu yang tepat untuk menyerahkan peralatan pertanian meliputi benih untuk ditanam sehingga akan mendapatkan hasil panen yang melimpah, kendi berisi air putih untuk penyubur tanaman padi, pupuk untuk menyuburkan panen, cangkul untuk mengolah sawah dengan sempurna, dan ruas bambu kuning serta daun andong dan kelaras daun pisang untuk menghindarkan padi dari serangan hama.\r\n\r\nTradisi ngarot memiliki tujuan untuk membina pergaulan yang sehat agar para pemuda-pemudi dapat saling mengenal dan bersatu untuk kemudian bisa mengolah dan menanam padi bersama-sama. (AL)', 'sosikal', , NULL, 1703034);
INSERT INTO `update_info` (`id_info`, `judul_info`, `info`, `tag_info`, `image`, `id_komentar`, `id_staff`) VALUES
(18, 'wisata lelea', 'Situ Bolang merupakan salah satu tempat wisata alternatif yang mempunyai daya tarik tersendiri. Situ Bolang terletak di Desa Jatisura Kecamatan Cikedung, 20 Km dari kota Indramayu. Wisata yang tersedia di Situ Bolang cukup beragam seperti memancing, area perkemahan dan rekreasi air. Situ Bolang juga memiliki nuansa pedesaan yang sangat kental dengan panorama pesawahan, ternak kambing, dan pohon Mangga yang tumbuh disekeliling Situ Bolang yang begitu menyajikan suasana nyaman. Situ Bolang juga terdapat warung makanan yang berdiri di pinggir danau sehingga menambah keindahan bila berkunjung ke situ bolang, danau situ bolang juga banyak terdapat ikan, bahkan banyak pengunjung yang datang hanya untuk sekedar memancing. Situ Bolang sebagai sebuah danau kini terus dikembangkan menjadi urat nadi perekonomian masyarakat. Situ Bolang yang jaraknya hanya 10 km dari jalur pantura Jakarta-Cirebon ini memiliki prospek yang cukup menggembirakan, tidak saja bagi lembaga pemberdayaan masyarakat (LPM) Desa Jatisura sebagai pengelola, tetapi juga bagi warga sekitar dan desa-desa tetangganya. Situ Bolang yang memiliki luas area genangan air 6,25 hektare dan menampung air hujan sekitar 425.000 m3, selain dimanfaatkan airnya untuk keperluan pengairan sawah masyarakat desa sekitar dan budi daya ikan, kawasan Situ Bolang juga telah dikembangkan menjadi sebuah lokawisata alam pedesaan oleh LPM Desa Jatisura. Meski dengan fasilitas seadanya, keindahan panorama alam dan kesejukan udara Situ Bolang pun dikembangkan menjadi sebuah lokawisata alam pedesaan oleh LPM Desa Jatisura. Ini dimulai dengan memperbaiki infrastruktur jalan menuju Situ Bolang secara bergotong royong oleh warga. Suasana alam pedesaan dengan latar belakang hamparan hutan jati dan pohon akasia milik Perum Perhutani di sekeliling Situ Bolang memang merupakan pemandangan yang sungguh indah sekaligus menyejukkan. Hal itu membuat kawasan tersebut cocok untuk dijadikan tempat bersantai.', 'Cerita', , NULL, 1703034);
